import React, { Component } from 'react'

export default class FunctionWork extends Component {
 constructor(){
    super();
    this.state={
        message:"hello hussain"
    }
 }
 change(){
    this.setState({
        message:"Alhumdullilah ! You are awesome "
    })
 }
    render() {
    return (
      <div>
        <h1>{this.state.message}</h1>
        <button onClick={()=>this.change()}>Click me </button>
      </div>
    )
  }
}
